import{_ as o}from"./Backbutton.55827dc5.js";import{a as n,b as t,e,f as i,h as r,o as s}from"./entry.18959fe1.js";const d={id:"pv"},c={class:"container"},b=r("<p data-v-e4e091a3><b data-v-e4e091a3> Cookiebeleid voor Rocketsourcers:</b><br data-v-e4e091a3><br data-v-e4e091a3> Bij Rocketsourcers waarderen we jouw privacy en streven we ernaar om transparant te zijn over het gebruik van cookies op onze website. Dit cookiebeleid legt uit wat cookies zijn, hoe we ze gebruiken, en hoe je jouw cookievoorkeuren kunt beheren.<br data-v-e4e091a3><br data-v-e4e091a3><b data-v-e4e091a3>Wat zijn cookies?</b><br data-v-e4e091a3> Cookies zijn kleine tekstbestanden die op jouw computer of mobiele apparaat worden opgeslagen wanneer je een website bezoekt. Ze worden gebruikt om informatie over jouw interactie met de website te verzamelen, zoals bezochte pagina&#39;s, inloggegevens, en andere statistieken.<br data-v-e4e091a3><br data-v-e4e091a3><b data-v-e4e091a3>Hoe gebruiken we cookies?</b><br data-v-e4e091a3> Rocketsourcers gebruikt cookies om je een betere browse-ervaring te bieden, om de prestaties en functionaliteit van de site te verbeteren, en om inzichten te verkrijgen in het gedrag van onze bezoekers.<br data-v-e4e091a3><br data-v-e4e091a3> - Noodzakelijke cookies: Deze cookies zijn essentieel voor de werking van onze website en kunnen niet worden uitgeschakeld.<br data-v-e4e091a3> - Prestatiecookies: Deze cookies helpen ons de prestaties van de website te analyseren en te optimaliseren.<br data-v-e4e091a3> - Functionaliteitscookies: Deze cookies stellen ons in staat om bepaalde functionaliteiten en personalisatie aan te bieden, zoals taalvoorkeuren.<br data-v-e4e091a3> - Wij maken gebruik van statistische cookies: Met deze statistische cookies verzamelen we gegevens om inzicht te krijgen in het gebruik van onze website door bezoekers. Deze gegevens laten ons zien welke pagina&#39;s het meest worden bezocht en welke zoektermen worden gebruikt, waardoor we onze site kunnen verbeteren. Het verwerken van onze webstatistieken en Hotjar-gegevens gebeurt op een versleutelde en anonieme manier, waardoor persoonsgegevens niet worden verzameld. We delen deze gegevens ook niet automatisch met Google, en onze eigen Google Analytics-cookies worden niet gecombineerd met andere diensten van Google, zoals DoubleClick. Het gebruik van deze cookies vereist geen expliciete toestemming, maar we willen je wel graag op de hoogte stellen van hun functionaliteit. <br data-v-e4e091a3><br data-v-e4e091a3><b data-v-e4e091a3>Hoe kun je jouw cookievoorkeuren beheren?</b><br data-v-e4e091a3> Je hebt de mogelijkheid om jouw cookievoorkeuren te beheren in jouw browserinstellingen. Afhankelijk van de browser die je gebruikt, kun je cookies accepteren of weigeren, of bepaalde soorten cookies blokkeren. Houd er rekening mee dat het volledig uitschakelen van cookies de functionaliteit van onze website kan beïnvloeden.<br data-v-e4e091a3><br data-v-e4e091a3><b data-v-e4e091a3>Wijzigingen in dit cookiebeleid</b><br data-v-e4e091a3> Rocketsourcers behoudt zich het recht voor om wijzigingen aan te brengen in dit cookiebeleid zonder voorafgaande kennisgeving. Eventuele wijzigingen worden hier gepubliceerd. We raden je aan deze pagina regelmatig te controleren op updates.<br data-v-e4e091a3><br data-v-e4e091a3><b data-v-e4e091a3>Contact</b><br data-v-e4e091a3> Als je vragen of opmerkingen hebt over ons cookiebeleid, neem dan contact met ons op via info@rocketsourcers.nl.<br data-v-e4e091a3><br data-v-e4e091a3> Laatste update: 4 augustus 2023. </p>",1),k={__name:"cookiebeleid",setup(v){return(l,g)=>{const a=o;return s(),t("div",null,[e("section",d,[e("div",c,[b,i(a)])])])}}},p=n(k,[["__scopeId","data-v-e4e091a3"]]);export{p as default};
